import React from 'react'
import { useLoaderData } from "react-router-dom";

const ProfilePage = () => {
    const userData = useLoaderData();

  return (
    <>
        <div>{userData.name}</div>
        <div>
            {userData.favorites}
        </div>
    </>
  )
}

export default ProfilePage;
